package hs.pojo;

public class HsCodeSelection {

	private String hsFirm;
	private String hsCust;
	private String hsPart;
	private String hsMura;
	private String hsPptc;


	public HsCodeSelection() {
		super();
		// TODO Auto-generated constructor stub
	}


	public HsCodeSelection(String hsFirm, String hsCust, String hsPart, String hsMura, String hsPptc) {
		this.hsFirm = hsFirm;
		this.hsCust = hsCust;
		this.hsPart = hsPart;
		this.hsMura = hsMura;
		this.hsPptc = hsPptc;
	}


	public String getHsFirm() {
		return hsFirm;
	}


	public void setHsFirm(String hsFirm) {
		this.hsFirm = hsFirm;
	}


	public String getHsCust() {
		return hsCust;
	}


	public void setHsCust(String hsCust) {
		this.hsCust = hsCust;
	}


	public String getHsPart() {
		return hsPart;
	}


	public void setHsPart(String hsPart) {
		this.hsPart = hsPart;
	}


	public String getHsMura() {
		return hsMura;
	}


	public void setHsMura(String hsMura) {
		this.hsMura = hsMura;
	}


	public String getHsPptc() {
		return hsPptc;
	}


	public void setHsPptc(String hsPptc) {
		this.hsPptc = hsPptc;
	}
	
	
}
